import 'package:flutter/material.dart';
import 'package:cart_management/Custom%20Widgets/custom%20CART%20card.dart';
import 'package:cart_management/Custom%20Widgets/custom%20appbar.dart';
import 'package:google_fonts/google_fonts.dart';

class CartPage extends StatefulWidget {
  const CartPage({super.key});

  @override
  State<CartPage> createState() => _CartPageState();
}

class _CartPageState extends State<CartPage> {
  final List<Product> _cart = [];

  void _addToCart(Product product) {
    setState(() {
      _cart.add(product);
    });
  }

  void _removeFromCart (Product product)
  {
    setState(() {
      _cart.remove(product);
    });
  }

  @override
  Widget build(BuildContext context) {
    return DefaultTabController(
      length: 2,
      child: Scaffold(
        backgroundColor: Colors.white,
        appBar: const CommonAppbar(tabtext1: "PRODUCTS", tabtext2: "MY CART"),
        body: TabBarView(
          children: [
            SingleChildScrollView(
              child: Column(
                children: [
                  CartCard(
                    images:
                        'data:image/jpeg;base64,',
                    productname: 'L.G Central AC',
                    productdetails:
                        'Central ac circulate cool air through a system of supply.',
                    productrate: " ₹ 35000 ",
                    onAddToCart: () {
                      _addToCart(Product(
                        name: 'L.G Central AC',
                        rate: '₹ 35000',
                      ));
                      // print('Product added to cart');
                    },
                  ),
                  const SizedBox(
                    height: 10,
                  ),
                  CartCard(
                      images:
                          'data:image/jpeg;base64,',
                      productname: 'Portable AC',
                      productdetails:
                          'A self-contained portable system ideal for cooling single rooms.',
                      productrate: '₹ 45000',
                      onAddToCart: () {
                        _addToCart(Product(
                          name: 'Portable AC',
                          rate: '₹ 45000',
                        ));
                      }),
                  const SizedBox(
                    height: 10,
                  ),
                  CartCard(
                      images:
                          'data:image/jpeg;base64,',
                      productname: 'Window AC',
                      productdetails:
                          'designed to condition the air in a single room or a large scale.',
                      productrate: '₹ 58000',
                      onAddToCart: () {
                        _addToCart(Product(
                          name: 'Window AC',
                          rate: '₹ 58000',
                        ));
                      }),
                  const SizedBox(
                    height: 10,
                  ),
                  CartCard(
                    images:
                        'data:image/jpeg;base64,',
                    productname: 'L.G Central AC',
                    productdetails:
                        '   Central ac circulate cool air through a system of supply.',
                    productrate: " ₹ 35000 ",
                    onAddToCart: () {
                      _addToCart(Product(
                        name: 'L.G Central AC',
                        rate: '₹ 35000',
                      ));
                      // print('Product added to cart');
                    },
                  ),
                  const SizedBox(
                    height: 10,
                  ),
                  CartCard(
                      images:
                          'data:image/jpeg;base64,',
                      productname: 'Portable AC',
                      productdetails:
                          'Self-contained portable system ideal for cooling single rooms.',
                      productrate: '₹ 45000',
                      onAddToCart: () {
                        _addToCart(Product(
                          name: 'Portable AC',
                          rate: '₹ 45000',
                        ));
                      }),
                  const SizedBox(
                    height: 10,
                  ),
                  CartCard(
                      images:
                          'data:image/jpeg;base64,',
                      productname: 'Window AC',
                      productdetails:
                          'designed to condition the air in a single room or a large scale.',
                      productrate: '₹ 58000',
                      onAddToCart: () {
                        _addToCart(Product(
                          name: 'Window AC',
                          rate: '₹ 58000',
                        ));
                      }),
                ],
              ),
            ),
     // ****** Second Tab View cart screen ******
            SingleChildScrollView(
              child: Column(
                children: _cart.map((product) {
                  return Padding(
                    padding: const EdgeInsets.all(8.0),
                    child: ListTile(
                      tileColor: Colors.blue[50],
                      title: Text(
                        product.name,
                        style: GoogleFonts.abyssinicaSil(
                            fontWeight: FontWeight.bold,color: Colors.red[900]),
                      ),
                      subtitle: Text(
                        product.rate,
                        style: GoogleFonts.abyssinicaSil(
                            fontWeight: FontWeight.bold, fontSize: 15),
                      ),
                      trailing: IconButton(onPressed: (){
                        _removeFromCart(product);
                      },
                          icon: Icon(Icons.delete,color: Colors.blueGrey,)),
                    ),
                  );
                }).toList(),
              ),
            ),
          ],
        ),
      ),
    );
  }
}

class Product {
  final String name;
  final String rate;

  Product({
    required this.name,
    required this.rate,
  });
}
